column14:
Aspecto profissional: me tornar um engenheiro de dados qualificado e disputado por empresas; continuar aprendendo e me qualificando o quanto puder;
Aspecto pessoal: construir a minha futura casa auto sustentável; poder auxiliar outras pessoas, principalmente pessoas com câncer;
Aspecto cidadão: contribuir para a sociedade, através do uso da T.I, com melhorias e/ou auxílio a descobertas/melhorias, principalmente, na área médica oncológica (tratamentos; p&d)
